import React from 'react';
import './App.css';
import './reset.css';
import Coolchart from './components/Infograph/infograph';
import MyBio from './components/Story/story';
import Test from './components/Test/test';
import NavBar from './components/Nav/nav';
import RenderWalk from './components/Parks and weather/parks';
import Game from './components/game/game';

/*
<NavBar />
<div className='app'>
<div id="bio"><MyBio className='bio' /></div>

<div id="chart"><Coolchart className='chart' /></div>
<div id="test" ><Test className='form'/></div>
<div id="walk"><RenderWalk  /> </div>
<div id="game"><Game  /> </div>
</div>
*/

class App extends ReactComponent {


  render() {return (
    <div >

<div className="head">
<h1>Sol Dvortsova</h1>

<p>Hi, I'm starting out as JS programmer. Look what I can do.</p>
</div>
<div className="works" onMouseEnter={this.giveInfo} onMouseLeave = {this.hideInfo}>
    <div className="graph">
        <p className="info">API Data Get and Graph Display</p>
        <p className="desc" >This app gets financial data and displays it on a graph</p>
    </div>
    <div className="mail">
      <p className="info">Forms, Tests and Subscriptions</p>
      <p className="desc" >This app gathers data and sends an email based on the info provided.</p>
    </div>
    <div className="park">
       <p className="info">API Data Get and List Display</p>
        <p className="desc" >This app displays parks in a chosen city</p>
    </div>
    <div className="igame">
        <p className="info">Interactive browser game</p>
        <p className="desc" >This app is a simple browser game</p>
    </div>
</div>
<div className="footer">
<p  >If you want to hire me, let me know.</p>
<a href="mailto: solvita.dvortsova@icloud.com?Subject=Hi Sol!" target="_top"><button>Contact via email</button></a>
<a href="https://t.me/BlockchainSol"><button>Contact via Telegram</button></a>
</div>

    </div>
  );}
};

export default App;
